function TabTechnician() {
  return (
      <>

          {/* Button Add */}
          <div className='flex justify-end mx-4 my-2'>
              <Button>
                  Add New
                  <span className="ml-2" aria-hidden="true">
                      +
                  </span>
              </Button>
          </div>




          {/* Table Data */}
          <TableTechnician />
      </>
  )
}

export default TabTechnician
